import React from 'react';
import './Header.css'; // Importa el archivo CSS para estilos

function Header(){
    return(
        <header className="header">
            <h1>Soluciones Éticas en Tecnología</h1>
            <p>Testing, desarrollo web y armado de aplicaciones con propósito.</p>

        </header>
    );
}
export default Header;
